import React, { useEffect, useState } from "react";
import '../App.css';
import { Switch, Route, NavLink } from 'react-router-dom';
import Home from "./Home";
import About from "./About";
import Settings from "./Settings";
import Login from "./Login";
import Account from "./Account";
import NavBar from "./NavBar";


function App() {

  useEffect(() => {
    fetch()
    .then(r => r.json())
    .then()
  }, [])

  return (
    <div className="App">
      <NavBar/>
      <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
        <Route path="/about">
          <About/>
        </Route>
        <Route path="/settings">
          <Settings/>
        </Route>
        <Route path="/login">
          <Login/>
        </Route>
        <Route path="/account">
          <Account/>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
